import React from "react";
import Card from './Card';
import "./index.css";
import carddata from "./data";


function App() {
    return (
        <>
            <div className="header">
                <h1>List of top 3 series</h1>
            </div>
            <div className="cards">
                <Card
                    imgsrc={carddata[0].imgsrc}
                    toptext={carddata[0].toptext}
                    title={carddata[0].title}
                    link={carddata[0].link}
                />
                <Card
                    imgsrc={carddata[1].imgsrc}
                    toptext={carddata[1].toptext}
                    title={carddata[1].title}
                    link={carddata[1].link}
                />
                <Card
                    imgsrc={carddata[2].imgsrc}
                    toptext={carddata[2].toptext}
                    title={carddata[2].title}
                    link={carddata[2].link}
                />
            </div>
        </>

    );
}

export default App;
